import HeroImage from './BGmain1.jpg';

export const Hero = () => {
  return (
    <div className="relative flex">
      <div className="w-3/12 bg-gray-200 overflow-hidden relative">
        <img className="w-full h-full object-cover" src={HeroImage} alt="Hero Image" />
        <h1 className="z-40 absolute top-0 left-0 text-9xl sm:w-auto text-center font-sans">
          Step to Wellness, One Foot at a Time.
        </h1>
      </div>
    </div>
  );
};

export default Hero;
